import HPS_logo from "../assets/HPS_logo.webp"
import React, { useState, useEffect } from 'react';
import { getDatabase, ref, onValue } from 'firebase/database';
import { useNavigate } from 'react-router-dom';
import { app } from './firebase.js'; // Assuming this is your Firebase config file
import "./HomePage.css"

const database = getDatabase(app);

function HomePage() {
  const [data, setData] = useState({ot: '', lvt: '', lv1t: '', lv2t: '', hvt: '', hum: '', 
    otha: '', lvtha: '', gora: '', moga: '', rly1: ''});
  const [coordinates, setCoordinates] = useState({ lat: '', lng: '' });
  const navigate = useNavigate();

  useEffect(() => {
    const dataRef = ref(database, 'realtimedata');
    const unsubscribe = onValue(dataRef, (snapshot) => {
      if (snapshot.exists()) {
        setData(snapshot.val());
      }
    });

    const coordRef = ref(database, 'coordinates');
    const coordUnsubscribe = onValue(coordRef, (snapshot) => {
      if (snapshot.exists()) {
        setCoordinates(snapshot.val());
      }
    });

    return () => {
      unsubscribe();
      coordUnsubscribe();
    };
  }, []);

  const handleredirect = () => {
    // Replace with your desi#f8d7da link
    window.location.href = 'https://example.com';
  };

  const getRowColor = (value, defaultColor, alertColor) => {
    return value === 0 ? alertColor : defaultColor;
  };

  return (
    <div className="homepage">
      <header>
      <img src={HPS_logo} alt="" className='logo'/>
            </header>

      <main>
        <div className="data-box">
          <h2>Real-time Data</h2>
          <div class="data-row">
            <span class="data-label">Oil Temperature:</span>
            <span class="data-value" data-field={data.ot} >{data.ot !== -37 ? data.ot: ''}</span>
          </div>
          <div class="data-row">
            <span class="data-label">lv Winding Temperature:</span>
            <span class="data-value" data-field="lvt">{data.lvt}</span>
          </div>
          <div class="data-row">
            <span class="data-label">lv1 Winding Temperature:</span>
            <span class="data-value" data-field="lv1t">{data.lv1t}</span>
          </div>
          <div class="data-row">
            <span class="data-label">lv2 Winding Temperature:</span>
            <span class="data-value" data-field="lv2t">{data.lv2t}</span>
          </div>
          <div class="data-row">
            <span class="data-label">hv Winding Temperature:</span>
            <span class="data-value" data-field="hvt">{data.hvt}</span>
          </div>
          <div class="data-row">
            <span class="data-label">Humidity:</span>
            <span class="data-value" data-field="hum">{data.hum !== -37 ? data.hum: ''}</span>
          </div>
          <div class="data-row" id="otha-row" style={{backgroundColor: getRowColor(data.otha, '#f9f9f9', '#f8d7da')}}>
            <span class="data-label">Oil temperature high alarm</span>
          </div>
          <div class="data-row" id="lvtha-row" style={{backgroundColor: getRowColor(data.lvtha, '#f9f9f9', '#f8d7da')}}>
            <span class="data-label">Winding temperature high alarm</span>
          </div>
          <div class="data-row" id="gora-row" style={{backgroundColor: getRowColor(data.gora, '#f9f9f9', '#f8d7da')}}>
            <span class="data-label">GOR alarm</span>
          </div>
          <div class="data-row" id="moga-row" style={{backgroundColor: getRowColor(data.moga, '#f9f9f9', '#f8d7da')}}>
            <span class="data-label">Oil level low alarm</span>
          </div>
          <div class="data-row" id="rly1-row" style={{backgroundColor: getRowColor(data.rly1, '#f8d7da', '#f9f9f9')}}> 
            <span class="data-label">Cooler on indication</span>
          </div>
        </div>

        <button onClick={handleredirect} className="redirect-button">
          Go to Link
        </button>

        <div className="coordinates">
          <h3>Current Coordinates</h3>
          <p>Latitude: {coordinates.lat}</p>
          <p>Longitude: {coordinates.lng}</p>
        </div>
      </main>
    </div>
  );
}


export default HomePage;
